		"text": "한일 양국의 웹소설의 결정적인 차이에 대한 장르론을 쓰고 싶은데 여러모로 난처하네요. 선행 연구가 제로에 가까워서\n1 논거로 쓸 자료 부족\n2 논증 및 일반화의 어려움\n3 과거에 대한 증언 부족\n결론적으로 가설의 입증이 어렵고, 단단하지 못해요.",
